import React from 'react';

function Contact(){
    return (
        <section id="contact" class="text-center">
      <a href="https://www.linkedin.com/in/wiratmoko/" class="btn btn-primary me-4">Check my LinkedIn</a>
      <a href="https://github.com/thepirateboy" class="btn btn-dark me-4">Go to my Github</a>
      <a href="https://yaeyx.com" class="btn btn-warning me-4">See my web resume</a>
      <a href="https://yaeyx.com/resume.pdf" class="btn btn-danger me-4">See my full resume</a>

      <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 1440 320">
        <path
          fill="#0C6FFD"
          fill-opacity="1"
          d="M0,320L40,314.7C80,309,160,299,240,277.3C320,256,400,224,480,224C560,224,640,256,720,250.7C800,245,880,203,960,202.7C1040,203,1120,245,1200,266.7C1280,288,1360,288,1400,288L1440,288L1440,320L1400,320C1360,320,1280,320,1200,320C1120,320,1040,320,960,320C880,320,800,320,720,320C640,320,560,320,480,320C400,320,320,320,240,320C160,320,80,320,40,320L0,320Z"
        ></path>
      </svg>
    </section>
    )
}

export default Contact;
